// src/App.js
import React from 'react';
import './App.css';
import SearchBar from './SearchBar';
import AddRemoveButtons from './AddRemoveButtons';
import JekLogo from './jek_logo.js';

const App = () => {
    return (
        <div style={{ position: 'relative' }}>
            <JekLogo />
            <div style={{ 
                display: 'flex', 
                alignItems: 'center', 
                justifyContent: 'flex-start', 
                paddingLeft: '200px', 
                paddingTop: '40px',
            }}>
                <h1 style={{ color: '#cedae1', marginRight: '20px' }}>jeKlibrary</h1>
                <SearchBar />
                <AddRemoveButtons />
            </div>
        </div>
    );
};

export default App;
